<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <meta name="x-apple-disable-message-reformatting">
  <meta http-equiv="X-UA-Compatible" content="ie=edge">
  <title>Reset Your Password</title>
  <style>
    body {
      margin: 0;
      padding: 0;
      font-family: Arial, sans-serif;
      background-color: #f8f9fa;
    }
    .email-container {
      margin: 0 auto;
      max-width: 600px;
      background-color: #ffffff;
      padding: 24px;
      border-radius: 8px;
      box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
    }
    .email-header {
      display: flex;
      align-items: center;
      justify-content: center;
      gap: 10px; /* Jarak antara logo dan teks */
      margin-bottom: 24px;
    }
    .email-header img {
      height: 40px; /* Ukuran logo */
    }
    .email-header .brand {
      color: #008f3b;
      font-size: 28px;
      font-weight: bold;
      margin: 0;
    }
    .email-body {
      text-align: center;
      margin: 24px 0;
    }
    .email-body .title {
      font-size: 20px;
      color: #343a40;
      margin-bottom: 12px;
    }
    .email-body .description {
      font-size: 14px;
      color: #6c757d;
      margin-bottom: 24px;
    }
    .email-body .btn {
      display: inline-block;
      padding: 12px 24px;
      font-size: 16px;
      color: #ffffff;
      background-color: #008f3b;
      text-decoration: none;
      border-radius: 4px;
    }
    .email-body .link {
      margin-top: 16px;
      font-size: 14px;
      color: #6c757d;
      word-break: break-word;
    }
    .email-footer {
      margin-top: 24px;
      text-align: center;
      font-size: 12px;
      color: #adb5bd;
    }
    .divider {
      margin: 24px 0;
      border: none;
      border-top: 1px solid #dee2e6;
    }
  </style>
</head>
<body>
  <div class="email-container">
    <!-- Header -->
    <div class="email-header">
      <svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="76" height="59" viewBox="0 0 76 59"> 
        <image xlink:href="data:image/png;base64," x="0" y="0" width="76" height="59"/> 
      </svg>
      <p class="brand">Green Cold Products</p>
    </div>

    <!-- Body -->
    <div class="email-body">
      <h2 class="title">Reset Your Password</h2>
      <p class="description">
        You recently requested to reset your password for your account. Click the button below to reset it.
      </p>
      <a href="{{ $resetUrl }}" class="btn">Reset Password</a>
      <p class="description">
        If you did not request this, please ignore this email or contact support.
      </p>
      <p class="link">
        If the button above does not work, copy and paste this link into your browser:
        <br>
        <a href="{{ $resetUrl }}">{{ $resetUrl }}</a>
      </p>
    </div>

    <hr class="divider">

    <!-- Footer -->
    <div class="email-footer">
      <p>&copy; {{ date('Y') }} Green Cold Products. All rights reserved.</p>
    </div>
  </div>
</body>
</html>
